var JsonLog = function (a) { return console.log(JSON.stringify(a)); };
var i1 = "";
var decodeInput = function (data) {
    var step = 10;
    var result = {
        methodSig: data.slice(0, step),
        args: new Array()
    };
    var currentArg = data.slice(step, step + 64);
    while (currentArg) {
        result.args.push(currentArg);
        step += 64;
        currentArg = data.slice(step, step + 64);
    }
    return result;
};
JsonLog(decodeInput(i1));
